import React from "react";
class Navi extends React.Component{
    constructor(props){
        super(props);
        this.state={
            name:"naveen yakkaluru",
            city:"tadipatri",
            role:"front end developer",
            copmany:"dell"
        }
    }
    handleRavi=()=>{
        this.setState({
            name:"mahesh nanndu",
            city:"banglore",
            role:"full stock developer",
            copmany:"tcs"
        })
    }
    render(){
        return(
            <div>
                {this.state.name}<br/>
                {this.state.city}<br/>
                {this.state.role}<br/>
                {this.state.copmany}<br/>
                <button onClick={this.handleRavi}>Add</button>

            </div>
        )
    }
}
export default Navi;
